import React,{useState,useEffect} from 'react'


const Display = () => {
    
    const [display , setDisplay]=useState([]);
    const getData=async()=>{
        try {
            const {StoreName,SerialNumber,MaterialNumber,MaterialDesc,OpeningBalance,RecievedQuantity,IssueQuantity,BalanceQuantity,Day_and_Date } = display;
            const data= await fetch("/userinput",{
                method: "POST",
          headers: {
            "Content-Type": "application/json",
          },
          body: JSON.stringify({
            StoreName,
            SerialNumber,
            MaterialNumber,
            MaterialDesc,
            OpeningBalance,
            RecievedQuantity,
            IssueQuantity,
            BalanceQuantity,
            Day_and_Date,
          }),
            });

            const result = await data.json();

            console.log(result.body);
            setDisplay(data.body)
        } catch (error) {
            
        }
    }
    
    useEffect(() => {
        getData();
    }, [])
    return (
        <div>
            <h1>Display</h1>
            {display.map(item=>{
                return <p>{item.data.body}</p>
            })}
        </div>
    )
}

export default Display
